import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import "./addevent.css";

const AddEvent = () => {
  const [eventData, setEventData] = useState({
    event_name: "",
    country: "",
    state: "",
    city: "",
    address: "",
    category: "",
    dateandtime: "",
    organised_by: "",
    description: "",
  });
  const [image, setImage] = useState(null); // For the image file

  const navigate = useNavigate();

  const handleChange = (e) => {
    setEventData({ ...eventData, [e.target.name]: e.target.value });
  };

  const handleImageChange = (e) => {
    setImage(e.target.files[0]); // Capture the selected image file
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Create FormData to handle file upload
    const formData = new FormData();
    formData.append("event_name", eventData.event_name);
    formData.append("country", eventData.country);
    formData.append("state", eventData.state);
    formData.append("city", eventData.city);
    formData.append("address", eventData.address);
    formData.append("category", eventData.category);
    formData.append("dateandtime", eventData.dateandtime);
    formData.append("organised_by", eventData.organised_by);
    formData.append("description", eventData.description);
    if (image) formData.append("image_url", image); // Append the image file if selected

    try {
      const response = await axios.post("http://127.0.0.1:8000/events", formData, {
        headers: {
          "Content-Type": "multipart/form-data",
        },
      });
      alert("Event added successfully!");
      navigate("/getevents", { state: { newEvent: response.data } });
    } catch (err) {
      console.error("Error details:", err.response?.data || err.message);
      alert("Failed to add event. Please try again.");
    }
  };

  return (
    <div className="add-event-form">
      <h1>Add New Event</h1>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="event_name"
          placeholder="Event Name"
          value={eventData.event_name}
          onChange={handleChange}
          required
        />
        <input
          type="file"
          name="image_url"
          onChange={handleImageChange}
          required
        />
        <input
          type="datetime-local"
          name="dateandtime"
          placeholder="Date and Time"
          value={eventData.dateandtime}
          onChange={handleChange}
          required
        />
        <select
          name="category"
          value={eventData.category}
          onChange={handleChange}
          required
        >
          <option value="" disabled>
            Select Category
          </option>
          <option value="Health & Wellness">Health & Wellness</option>
          <option value="Technology">Technology</option>
          <option value="Entertainment">Entertainment</option>
          <option value="Education">Education</option>
          <option value="Sports">Sports</option>
          <option value="Marriage">Marriage</option>
          <option value="Other">Other</option>
        </select>
        <input
          type="text"
          name="organised_by"
          placeholder="Organised By"
          value={eventData.organised_by}
          onChange={handleChange}
          required
        />
        <textarea
          name="description"
          class=".description-input"
          placeholder="Description"
          value={eventData.description}
          onChange={handleChange}
          required
          rows="4"
        />
        <input
          type="text"
          name="country"
          placeholder="Country"
          value={eventData.country}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="state"
          placeholder="State"
          value={eventData.state}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="city"
          placeholder="City"
          value={eventData.city}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="address"
          placeholder="Address"
          value={eventData.address}
          onChange={handleChange}
          required
        />
        <button type="submit" className="submit-btn">
          Submit
        </button>
      </form>
    </div>
  );
};

export default AddEvent;
